import "./App.css";
import React, { Fragment } from "react";
import { Link } from "react-router-dom";

/*************************************************************************/
const rightBarStyle = {
    textAlign: "right",
    paddingTop: "10px",
    paddingRight: "20px",
    marginBottom: '10'
};

export const Header = () => {

    let links =
        <Fragment>
            <Link to="/login" style={{ display: "block", color: '#FFF' }}>
                Log In
            </Link>
            <Link to="/register" style={{ display: "block", color: '#FFF' }}>
                Register
            </Link>
        </Fragment>;

    return (
        <nav className="navbar bg-dark">
            <div className="col-sm-8" style={{ color: '#50c1ff' }}>
                <h2>Macgugin Dining Center Menu</h2>
            </div>
            <div className="col-sm-4" style = {rightBarStyle}>{links}</div>
        </nav>
    );
};
